import React, { Component } from "react";
import Country from "./Country"
import "./App.css";

class App extends Component {

  componentDidMount() {
    fetch("https://restcountries.eu/rest/v2/all")
      .then(res => res.json())
      .then(jsonRes => {
        console.log('====================================')
        console.log(jsonRes)
        console.log('====================================')
    })
  }

  render() {
    return (
      <div className="App">
        <h1>Countries of the World</h1>
        {
          [res.json].map (country => {
            return (
              <Country />
            )
          })}
      </div>
    );
  }
}

export default App;
